import HarvestPhotos from './Harvest'
import HarvestContext from '../context/HarvestProvider'
import UserContext from '../context/UserProvider'





export default function HarvestList(props) {

const {getAllHarvests, harvests} = useContext(HarvestContext)  


    useEffect(()=>{

        getAllHarvests()



        }, []
    )       



    return(
        <div>

            <h1>Current Available Harvests</h1>
            {props.harvests.map(harvest => <HarvestPhotos image={props.user.imageUrl} label={harvest.body} { ...harvest} 
            key={Math.floor(Math.random()* Math.floor(1000))}/>  )}
        </div>
    )
}
